export default function Todos(props) {
    const todos = props.map(prop=>{
        <div class="todos">
            <div class="input">
                <div class="input__inputs">
                    <h1>{prop.header}</h1>
                    <p>{prop.task}</p>
                </div>
            </div>
        </div>
    })
    return(todos);
}
